import React from 'react';
import './Categories.css';

const products = [
  {
    id: 1,
    name: "Telephone",
    description: "Good telephone.",
    price: "25000 TL",
    image: "/images/1.png",
    category: "Telephone"
  },
  {
    id: 2,
    name: "Television",
    description: "Great television.",
    price: "35000 TL",
    image: "/images/2.png",
    category: "TV"
  },
  {
    id: 3,
    name: "Laptop",
    description: "Performance laptop.",
    price: "50000 TL",
    image: "/images/3.png",
    category: "Laptop"
  },
  {
    id: 4,
    name: "Xbox",
    description: "Playing games.",
    price: "20000 TL",
    image: "/images/4.png",
    category: "Consoles"
  },
  {
    id: 5,
    name: "Toast Machine",
    description: "Hungry solver.",
    price: "1500 TL",
    image: "/images/5.png",
    category: "Accessory"
  },
  {
    id: 6,
    name: "Washing Machine",
    description: "Clean clothes.",
    price: "15000 TL",
    image: "/images/6.png",
    category: "White"
  },
  {
    id: 7,
    name: "Dishwasher",
    description: "Clean dishes.",
    price: "17000 TL",
    image: "/images/7.png",
    category: "White"
  },
  {
    id: 8,
    name: "PS5",
    description: "Game play.",
    price: "40000 TL",
    image: "/images/8.png",
    category: "Consoles"
  },
];


const CategoriesPage = () => {
  const categories = [
    { name: 'Telephone', path: '/categories/telephone' },
    { name: 'TV', path: '/categories/tv' },
    { name: 'Laptop', path: '/categories/laptop' },
    { name: 'White', path: '/categories/white' },
    { name: 'Accessory', path: '/categories/accessory' },
    { name: 'Consoles', path: '/categories/consoles' },
  ];

  return (
    <div className="categories-page">
      <h1>Categories</h1>
      <ul className="category-list">
        {categories.map((category, index) => (
          <li key={index} className="category-item">
            <a href={category.path}>{category.name}</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CategoriesPage;
